import React from "react";
import { Form, FormGroup, Input, Label } from "reactstrap";

export default function SiparisForm() {
  return (
    <div className="siparisContainer">
      <Form>
        <FormGroup className="d-flex justify-content-between">
          <Label className="fw-bold">
            Boyut Seç*
            <Input className="p-4 text-black" type="button" placeholder="S" />
          </Label>
          <Label className="fw-bold">Hamur Seç*</Label>
        </FormGroup>
        <FormGroup>
          <Label className="fw-bold">Ek Malzemeler</Label>
        </FormGroup>
      </Form>
    </div>
  );
}
